import React from "react";
import { Grid, Block } from "./styles";
import Icon, { RiseOutlined } from "@ant-design/icons";

const Blocks = () => {
  return (
    <>
      <Grid>
        <Block>
          <Icon component={RiseOutlined} height={3} width={3}></Icon>
          <h4>Total Sales</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <h4>Transactions</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <h4>Total Item Sold</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <h4>Cost of Goods</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <h4>Profit</h4>
          <p>0.000</p>
        </Block>
      </Grid>
    </>
  );
};

export default Blocks;
